function SidebarPoint(props) {
  const { name } = props;
  return (
    <div>
      <h1>{name}</h1>
    </div>
  );
}

function Sidebar() {
  return (
    <div>
      <SidebarPoint name="Home" />
      <SidebarPoint name="Doctor stats" />
      <SidebarPoint name="Home" />
    </div>
  );
}

export default Sidebar;
